A mish mash of painting and snowboarding clips from this past winter. 24 total days riding for the 22/23 season — more days on the mountain than I’ve gotten in the last several years. As usual, I did several paintings. Included here is a selection of 4 of them. 

If you couldn’t tell who’s who in this video, I’m wearing blue and that’s my cousin Wes in the orange and black outfit (@m_dubya_a). I drove out to visit him in SLC at the end of February when Utah was right in the midst of a very snowy winter with unprecedented snow accumulation.

